using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;

namespace sort_characters_by_frequency
{
    class Solution
    {
        public static string FrequencySort(string s) {
            
            Dictionary<char, int> items = new Dictionary<char, int>();
            foreach(char ele in s.ToCharArray()){
                if(items.ContainsKey(ele)){
                    items[ele]++;
                }else{
                    items[ele] = 1;
                }
            }

            /*  foreach(KeyValuePair<char,int> test in items){
                Console.Write(test.Key);
            }
            Console.WriteLine(); */

            //var map = items.OrderByDescending(x => x.Value);
            items = items.OrderByDescending(x => x.Value).ToDictionary(x => x.Key, x => x.Value);

            /* foreach(KeyValuePair<char,int> test in items){
                Console.Write(test.Key);
            }
            Console.WriteLine(); */
            //foreach(KeyValuePair<char,int> test in map){
            StringBuilder result = new StringBuilder();
         
            foreach(KeyValuePair<char,int> pair in items)
            {
                int n = pair.Value;
                while(n-- > 0)
                result.Append(pair.Key);
            }

           
            return result.ToString();
        }
        public static void Main(string[] args)
        {
            var watch = System.Diagnostics.Stopwatch.StartNew();
            Console.WriteLine(FrequencySort("tree"));
            Console.WriteLine(FrequencySort("cccaaa"));
            Console.WriteLine(FrequencySort(""));
            watch.Stop();
            var elapsedMs = watch.ElapsedMilliseconds;
            Console.WriteLine(elapsedMs);
        }
    }
}
